package yarnwrap.world.gen.feature;
public class ConfiguredFeatures { public net.minecraft.world.gen.feature.ConfiguredFeatures wrapperContained; public ConfiguredFeatures(net.minecraft.world.gen.feature.ConfiguredFeatures wrapperContained) { this.wrapperContained = wrapperContained; }

public void bootstrap(yarnwrap.registry.Registerable featureRegisterable) { wrapperContained.bootstrap(featureRegisterable.wrapperContained); }
public yarnwrap.world.gen.feature.RandomPatchFeatureConfig createRandomPatchFeatureConfig(int tries,yarnwrap.registry.entry.RegistryEntry feature) { return new yarnwrap.world.gen.feature.RandomPatchFeatureConfig(wrapperContained.createRandomPatchFeatureConfig(tries,feature.wrapperContained)); }
public yarnwrap.world.gen.feature.RandomPatchFeatureConfig createRandomPatchFeatureConfig(yarnwrap.world.gen.feature.Feature feature,yarnwrap.world.gen.feature.FeatureConfig config) { return new yarnwrap.world.gen.feature.RandomPatchFeatureConfig(wrapperContained.createRandomPatchFeatureConfig(feature.wrapperContained,config.wrapperContained)); }
public yarnwrap.world.gen.feature.RandomPatchFeatureConfig createRandomPatchFeatureConfig(yarnwrap.world.gen.feature.Feature feature,yarnwrap.world.gen.feature.FeatureConfig config,java.util.List predicateBlocks) { return new yarnwrap.world.gen.feature.RandomPatchFeatureConfig(wrapperContained.createRandomPatchFeatureConfig(feature.wrapperContained,config.wrapperContained,predicateBlocks)); }
public yarnwrap.world.gen.feature.RandomPatchFeatureConfig createRandomPatchFeatureConfig(yarnwrap.world.gen.feature.Feature feature,yarnwrap.world.gen.feature.FeatureConfig config,java.util.List predicateBlocks,int tries) { return new yarnwrap.world.gen.feature.RandomPatchFeatureConfig(wrapperContained.createRandomPatchFeatureConfig(feature.wrapperContained,config.wrapperContained,predicateBlocks,tries)); }
public void register(yarnwrap.registry.Registerable registerable,yarnwrap.registry.RegistryKey key,yarnwrap.world.gen.feature.Feature feature,yarnwrap.world.gen.feature.FeatureConfig config) { wrapperContained.register(registerable.wrapperContained,key.wrapperContained,feature.wrapperContained,config.wrapperContained); }
// public yarnwrap.world.gen.blockpredicate.BlockPredicate createBlockPredicate(java.util.List validGround) { return new yarnwrap.world.gen.blockpredicate.BlockPredicate(wrapperContained.createBlockPredicate(validGround)); }
public void register(yarnwrap.registry.Registerable registerable,yarnwrap.registry.RegistryKey key,yarnwrap.world.gen.feature.Feature feature) { wrapperContained.register(registerable.wrapperContained,key.wrapperContained,feature.wrapperContained); }
public yarnwrap.registry.RegistryKey of(java.lang.String id) { return new yarnwrap.registry.RegistryKey(wrapperContained.of(id)); }

}